import React from 'react';
import axios from 'axios';
const queryString = require('query-string');

class Search extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      listData: [],
    };
  }

  componentDidMount = async () => {
    const parsed = queryString.parse(this.props.location.search);
    const keyword = parsed.query || '';
    // if (!keyword) {
    //   this.props.history.push('/');
    // }

    const token = localStorage.getItem('token') || '';
    console.log('check', token);

    if (!token) {
      this.props.history.push('/login');
    }
    const url = `https://d2irr0mp54galb.cloudfront.net/cms/read/en-AU`;

    let result = await axios({
      method: 'post',
      url,
      data: {
        operationName: 'ListBlogPosts',
        query:
          'query ListBlogPosts {\n  listBlogPosts(\n    limit: 12\n    sort: postDate_DESC\n    where: {country: {id_in: ["62acc4fbd95fb30009606999#0002"]}}\n    after: "WyIxNjU1NDkwNjUyMDAwIl0="\n  ) {\n    data {\n      content\n      city {\n        createdOn\n        entryId\n        id\n        name\n        public\n        savedOn\n        country {\n          code\n          createdOn\n          flag\n          entryId\n          id\n          name\n          public\n          savedOn\n          _typename\n        }\n        _typename\n      }\n      country {\n        code\n        createdOn\n        entryId\n        flag\n        name\n        id\n        public\n        savedOn\n        _typename\n      }\n      createdOn\n      description\n      entryId\n      id\n      postDate\n      public\n      savedOn\n      thumbnail\n      title\n      topic {\n        createdOn\n        entryId\n        id\n        order\n        public\n        savedOn\n        slug\n        title\n        _typename\n      }\n      _typename\n    }\n    meta {\n      totalCount\n      hasMoreItems\n      cursor\n      _typename\n    }\n    __typename\n  }\n}\n',
      },
      headers: {
        Authorization: `a67550392f105ba5ecb8765d866b06a2735f96269b96767`,
      },
    });

    result = result.data;
    console.log('result', result);

    // this.setState({
    //   listData: res.data,
    // });
  };

  render() {
    const { listData } = this.state;
    return (
      <div className='container'>
        {/* {listData.map((value) => {
          return (
            <div className='content' key={value.id}>
              {value.title}
            </div>
          );
        })} */}
        {listData.map((value) => {
          return (
            <div className='content' key={value.id}>
              {value.data}
            </div>
          );
        })}
      </div>
    );
  }
}

export default Search;
